import React, { Component } from "react";
export default class Login extends Component {
  render() {
    return (
      <div>
        <input placeholder="Enter your Email" />
        <br />
        <input placeholder="Enter Your password" />
        <br />
        <button>Login</button>
        <br />
        <button>SignUp</button>
      </div>
    );
  }
}
